import { useState } from "react";
import { Card, CardHeader } from "react-bootstrap";

function NewsCard({NewsItems}){
    return(
       <>
       {NewsItems.map((artical, index)=> (
           
           <Card>
            <CardHeader>
                <h5 style={{fontFamily:"inherit"}}></h5>
            </CardHeader>

          </Card>
        ))}
       </>
    );
}

export default NewsCard;
